import styled from "styled-components";

export const TelaInicial = styled.html`
  position: relative;
  margin: 0;
  padding: 0;
  width: 100%;
`;

export const Cabecalho = styled.div`
  background-color: black;
  color: white;
  margin: 0.5%;
  padding: 0.5%;
  font-family: Arial, Helvetica, sans-serif;
`;
